import React from "react";
import {HeaderWrapper, Logo} from "./header_style";
class Header extends React.Component{
    render(){
        return (
            <HeaderWrapper>
                <Logo href="/"></Logo>
            </HeaderWrapper>
        )
    }
}

export default Header;
